import React from 'react';
import * as S from './paintStyles';

const ShoeGallery = () => {
  const shoes = ['Air Force 1', 'Dunk', 'Air Jordan 1', 'Air Max'];

  return (
    <S.Container>
      <S.Grid>
        {shoes.map((shoe, index) => (
          <S.Card key={index}>
            <S.Title>{shoe}</S.Title>
          </S.Card>
        ))}
      </S.Grid>
    </S.Container>
  );
};

export default ShoeGallery;
